import React from 'react';

function Header() {
  return (
    <header style={{ background: '#0c872fff', color: '#fff', padding: '1rem', textAlign: 'center' }}>
      <h1 style={{
        fontFamily: `'Pacifico', 'Comic Sans MS', 'Brush Script MT', cursive`,
        fontSize: '2.5rem',
        letterSpacing: '2px',
        textShadow: '2px 2px 8px #00000033',
        margin: 0
      }}>
        LydsArt
      </h1>
    </header>
  );
}

export default Header;
